INSERT INTO `posts` VALUES (1, 1, 'Website', 'bardi', '2018-10-16', 'Boeremark.jpg', '<p>Website adalah kumpulan halaman web yang saling terhubung dan dapat diakses melalui internet. Website biasanya dikelola oleh satu atau beberapa individu atau organisasi, dan memiliki nama domain yang unik.</p><figure class=\"table\"><table><tbody><tr><th>&nbsp;</th><th>Definisi</th></tr><tr><th>Pengertian</th><th>Kumpulan halaman web yang saling terhubung dan dapat diakses melalui internet</th></tr><tr><th>Komponen</th><th>Teks, gambar, video, animasi, dan elemen lainnya</th></tr><tr><th>Domain</th><th>Alamat unik yang digunakan untuk mengakses website, seperti www.contoh.com</th></tr><tr><th>Hosting</th><th>Tempat menyimpan semua data dan file yang ada di website</th></tr><tr><th>Bahasa pemrograman</th><th>HTML, CSS, dan JavaScript</th></tr><tr><th>Fungsi</th><th>Penyebaran informasi, berbagi konten, atau menyediakan layanan kepada pengguna internet</th></tr></tbody></table></figure><p>Website dapat digunakan untuk berbagai keperluan, seperti bisnis, pendidikan, hiburan, dan lainnya.</p>', 'harshit,website', 2, 'draft', 1);
