INSERT INTO `posts` VALUES (4, 1, 'Life', 'bardi', '2019-01-10', 'life-008.jpg', '<p>Kata life dalam bahasa Inggris merupakan kata benda (noun) yang berarti kehidupan atau masa hidup seseorang atau sesuatu. Kata ini juga dapat merujuk pada keadaan hidup itu sendiri.</p><p>Selain itu, life juga dapat memiliki makna lain, seperti:</p><ul><li>Vitalitas, semangat, dan energi</li><li>Keberadaan individu manusia atau hewan</li></ul><p>Bentuk plural dari kata life adalah lives.</p><p>Contoh penggunaan kata life dalam kalimat:</p><ul><li>Life is precious yang berarti Hidup adalah anugerah yang berharga</li><li>She has lived a full life yang berarti Dia telah menjalani hidup yang penuh makna</li></ul><p>&nbsp;</p>', 'life , ctrl', 0, 'published', 0);
INSERT INTO `posts` VALUES (5, 3, 'Jiu Jitsu', 'bardi', '2024-12-03', 'lgJiujitsu.png', '<p>Jiu jitsu adalah seni bela diri Jepang yang menggunakan teknik-teknik fleksibel untuk melumpuhkan lawan tanpa senjata. Teknik-teknik yang digunakan dalam jiu jitsu, antara lain:</p><ul><li>Atemi waza, yaitu menyerang bagian tubuh lawan yang lemah</li><li>Kansetsu waza/gyakudori, yaitu mengunci persendian lawan</li><li>Nage waza, yaitu menjatuhkan lawan</li></ul><p>Jiu jitsu merupakan salah satu seni bela diri tertua yang ada hingga saat ini. Teknik-tekniknya berasal dari metode pembelaan diri kaum samurai yang kehilangan atau tidak ingin menggunakan pedangnya.</p><p>Jiu jitsu memiliki beberapa aliran, yaitu tradisional dan modern. Perbedaannya terletak pada jurus-jurusnya, di mana jurus-jurus jiu jitsu modern disesuaikan dengan situasi pembelaan diri saat ini, sedangkan jiu jitsu tradisional mencerminkan situasi pembelaan diri saat alirannya diciptakan.</p><p>Jiu jitsu juga memiliki beberapa varian, di antaranya:</p><ul><li><strong>Brazilian Jiu Jitsu</strong>: Varian jiu jitsu yang berfokus pada pertarungan lantai, seperti bantingan, cekikan, dan kuncian. Jiu jitsu Brazil lebih lembut dan fokus pada teknik jepitan, berbeda dengan jiu jitsu Jepang yang cenderung lebih agresif.</li></ul><p>&nbsp;</p>', 'Jiu Jitsu', 0, 'published', 0);
INSERT INTO `posts` VALUES (6, 3, 'Karate', 'bardi', '2024-12-03', 'lgKarate.png', '<p>Karate adalah seni bela diri yang berasal dari Jepang yang menggunakan tangan kosong untuk menyerang dan bertahan:</p><ul><li><strong>Definisi</strong>: Karate adalah olahraga pertarungan tangan kosong yang berasal dari Jepang.</li></ul><p>&nbsp;</p><ul><li><strong>Tujuan</strong>: Tujuan karate adalah untuk mempertahankan diri, menjaga kesehatan, dan menjaga kebugaran jasmani.</li></ul><p>&nbsp;</p><ul><li><strong>Teknik</strong>: Karate menggunakan teknik pukulan, tendangan, tangkisan, dan pertahanan. Karateka menggunakan telapak tangan, tumit, lutut, dan siku untuk menyerang titik lemah lawan.</li></ul><p>&nbsp;</p><ul><li><strong>Prinsip</strong>: Karate mengutamakan konsentrasi, kekuatan tubuh, taktik, dan kedisiplinan.</li></ul><p>&nbsp;</p><ul><li><strong>Kata</strong>: Kata adalah kumpulan gerakan dan teknik karate yang dipraktikkan secara solo.</li></ul><p>Karate diperkenalkan ke Jepang pada tahun 1916 oleh Gichin Funakoshi. Nama karate berasal dari dua kanji, yaitu \"kara\" (kosong) dan \"te\" (tangan). Sebelumnya, karate disebut \"Tote\" yang berarti \"tinju China\".</p><p>Di Indonesia, karate diperkenalkan oleh mahasiswa Indonesia yang pernah belajar di Jepang. Pada tahun 1963, para mahasiswa tersebut mendirikan Dojo di Jakarta dan membentuk perkumpulan karate bernama PORKI (Persatuan Olahraga Karate Indonesia).</p><p>&nbsp;</p>', 'Karate', 0, 'published', 0);
INSERT INTO `posts` VALUES (7, 3, 'Boxing', 'bardi', '2024-12-03', 'lgBoxing.png', '<p><strong>Tinju</strong> adalah olahraga dan seni bela diri yang menampilkan dua orang partisipan dengan berat yang serupa bertanding satu sama lain dengan menggunakan tinju mereka dalam rangkaian pertandingan berinterval satu atau tiga menit yang disebut ronde. Baik dalam Olimpiade ataupun olahraga profesional, kedua petinju menghindari pukulan lawan mereka sambil berupaya mendaratkan pukulan mereka sendiri ke lawannya.</p><p>Nilai diberikan untuk pukulan yang bersih dan mantap sampe bonyok ke bagian depan pinggang ke atas ke muka ke otak yang sah dari lawan, dengan pukulan ke kepala dan dada mendapat nilai lebih. Petinju dengan nilai yang lebih tinggi setelah sejumlah ronde yang direncanakan akan dinyatakan sebagai pemenang. Kemenangan juga dapat dicapai jika lawan dipukul jatuh dan tidak dapat bangkit sampai hitungan kesepuluh dari wasit (suatu <i>Knockout</i> atau KO) atau jika lawan dinyatakan tidak mampu melanjutkan pertandingan (suatu <i>Technical Knockout</i> atau TKO). Untuk keperluan rekor pertandingan , <i>TKO</i> dihitung sebagai <i>KO</i>.</p>', 'Boxing', 0, 'published', 0);
INSERT INTO `posts` VALUES (8, 3, 'Muay Thai', 'bardi', '2024-12-03', 'lgMuaythai.png', '<p>Muay Thai adalah olahraga bela diri yang berasal dari Thailand yang menggunakan tangan, siku, lutut, dan kaki untuk menyerang dan bertahan. Muay Thai juga dikenal sebagai Thai Boxing.</p><p>Muay Thai memiliki beberapa karakteristik, di antaranya:</p><p><strong>Nama</strong></p><p>Kata \"muay\" berarti tinju bela diri, sedangkan \"thai\" adalah suku Thai dari Thailand.</p><p>&nbsp;</p><p><strong>Teknik</strong></p><p>Muay Thai mengajarkan delapan titik kontak, sehingga disebut juga sebagai \"Ilmu Delapan Tungkai\".</p><p>&nbsp;</p><p><strong>Sejarah</strong></p><p>Muay Thai merupakan turunan dari bela diri kuno Muay Boran dan diyakini berevolusi dari pelatihan tentara Thailand yang dibentuk pada 1238.</p><p>&nbsp;</p><p><strong>Manfaat</strong></p><p>Muay Thai dapat meningkatkan stamina, kesehatan, dan kebugaran tubuh secara menyeluruh.</p><p>&nbsp;</p><p><strong>Teknik bertarung</strong></p><p>Muay Thai sering merupakan seni tempur kontak penuh, di mana lawan saling bertukaran pukulan.</p><p>&nbsp;</p><p>Muay Thai merupakan olahraga yang populer di dunia dan digemari oleh banyak orang, baik pria maupun wanita</p><p><strong>Perbedaan dengan kickboxing</strong></p><p>Muay Thai memiliki beberapa perbedaan mendasar dengan kickboxing, di antaranya teknik serangan yang juga memanfaatkan siku dan lutut.</p><p>&nbsp;</p>', 'Muay Thai', 0, 'published', 0);
