INSERT INTO `posts` VALUES (14, 7, 'Coaching', 'admin', '2024-12-08', '', '<p>Coaching is a process where an experienced person, or coach, helps a client or learner achieve a goal through guidance, training, and advice. The coach\'s role is to help the client learn and simplify processes to help them achieve their goals.</p><p>Here are some things to learn about coaching:</p><p><strong>Coaching is about facilitating learning</strong></p><p>The coach helps the client learn, rather than teaching them. The coach believes that the client has the answers to their own problems, but may need help finding them.</p><p>&nbsp;</p><p><strong>Coaching is about the individual</strong></p><p>The coach should understand the person they are coaching, including their motivations and preferences. This helps the coach create an environment that meets the client\'s needs and boosts motivation.</p><p>&nbsp;</p><p><strong>Coaching is about the present</strong></p><p>Coaching focuses on the present, rather than the past or future.</p><p>&nbsp;</p><p><strong>Coaching is about creating a safe space</strong></p><p>The coach should create a safe space for the client, be patient, and be hyper-focused on what the client is saying.</p><p>&nbsp;</p><p>Some places to learn about coaching include:</p><ul><li><strong>Coach Learning Framework</strong>: This framework helps coaches develop their knowledge and confidence.</li></ul><p>&nbsp;</p><ul><li><strong>International Coach Academy</strong>: This academy offers a variety of training levels, including introductory, professional, and advanced.</li></ul><p><strong>The word \"coach\" comes from a wheeled vehicle</strong></p><p>The word \"coach\" comes from the wheeled vehicles that were pulled by horses and carried people from one place to another.</p><p>&nbsp;</p>', 'Learn Coach', 0, 'published', 0);
